import React from 'react';
import './App.css';
import {BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from './componets/Layout';
import Home from "./pages/Home";
function App() {
  return (
     <>
      <BrowserRouter>
         <Routes>
          <Route path='/' element={<Layout />}>
          <Route index element={<Home />} />
          </Route>
         </Routes>
      </BrowserRouter>

     </>
  );
}

export default App;
